import React from "react";
import "./Home.css";

export default function Home() {
  return (
    <div className="home">
      <header>Welcome to my cheer info site! :)</header>{" "}
      <p>
        My goal for this website is to contain everything cheer related for the
        UK - this includes competitions and teams that have won bids to
        international competitions!
      </p>
    </div>
  );
}
